import SearchForm from "./SearchForm";

var enteredData;

const RetrieveData = (props) => {
  const onSearchDataHandler = (data) => {
    enteredData = { ...data };

      const summoner_name = enteredData.user;
      const region = enteredData.region;
      const riotAPIKey = "RGAPI-66e7cf60-65b9-4d51-a9cd-5ccadc9cb5e9";

    //Get summoner ID
      const summoner_id_response = fetch(
        `https://oc1.api.riotgames.com/lol/summoner/v4/summoners/by-name/${summoner_name}?api_key=${riotAPIKey}`,
        {
          accept: {
            "Content-Type": "application/json",
          },
        }
      )
    const summoner_id = summoner_id_response.json()["id"]
    console.log(summoner_id);
    
     // Get clash team ID

  };

  return <SearchForm onSaveSearch={onSearchDataHandler}/>;
};

export default RetrieveData;
